import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import classnames from "classnames";

//componenti da react-bootstrap
import { Container, Row, Col, Button } from "react-bootstrap";

class SchermataIniziale extends Component {
  componentDidMount() {
    //se sei autenticato e provi ad andare indietro
    // If logged in and user navigates to Login page, should redirect them to dashboard
    if (this.props.auth.isAuthenticated) {
      this.props.history.push("/HomeCliente");
    }
  }

  render() {
    return (
      <Container
        style={{
          marginTop: "10rem",
          marginBottom: "17rem",
          backgroundColor: "#010101",
        }}
      >
        <Row className="justify-content-md-center">
          <Col md="auto">
            <Button
              variant="primary"
              size="lg"
              style={{ borderRadius: "40px" }}
              href="/login"
              className="bottone"
            >
              Accedi
            </Button>{" "}
          </Col>
        </Row>
      </Container>
    );
  }
}

SchermataIniziale.propTypes = {
  auth: PropTypes.object.isRequired,
  errors: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
  errors: state.errors,
});

export default connect(mapStateToProps)(SchermataIniziale);
